CREATE TABLE political_parties (
    `list_party_id` INT,
    `list_party_name` VARCHAR(42) CHARACTER SET utf8,
    `list_party_acronym` VARCHAR(18) CHARACTER SET utf8,
    `list_financial_year` VARCHAR(7) CHARACTER SET utf8,
    `list_total_assets` NUMERIC(7, 2),
    `list_total_liabilities` NUMERIC(7, 2),
    `list_total_income` NUMERIC(7, 2),
    `list_total_expenditure` NUMERIC(7, 2),
    `list_asset_url` VARCHAR(45) CHARACTER SET utf8,
    `list_total_donation` NUMERIC(12, 2),
    `list_no_of_donors` INT,
    `list_average_donation` NUMERIC(10, 2),
    `list_donation_url` VARCHAR(50) CHARACTER SET utf8
);
